import{f as e,h as t,j as n,t as r}from"./chunks/plugin-vue_export-helper.Dz-VHcSB.js";const i=JSON.parse(`{"title":"Uninstall Android Apps","description":"Remove preinstalled and bloatware apps from Android phone","frontmatter":{"title":"Uninstall Android Apps","description":"Remove preinstalled and bloatware apps from Android phone"},"headers":[],"relativePath":"Collection/Android/Uninstall_Android_Apps.md","filePath":"Collection/Android/Uninstall_Android_Apps.md","lastUpdated":1767053997000}`);var a={name:`Collection/Android/Uninstall_Android_Apps.md`};function o(r,i,a,o,s,c){return n(),e(`div`,null,[...i[0]||=[t(`<h1 id="uninstall-android-apps" tabindex="-1">Uninstall Android Apps <a class="header-anchor" href="#uninstall-android-apps" aria-label="Permalink to “Uninstall Android Apps”">​</a></h1><p>Follow the bellow steps to uninstall pre-installed apps</p><div class="caution custom-block github-alert"><p class="custom-block-title">SAFETY NOTE</p><p>Please disable the apps instead of uninstalling. As it may cause system issues</p></div><h2 id="steps-without-root" tabindex="-1">Steps (Without Root) <a class="header-anchor" href="#steps-without-root" aria-label="Permalink to “Steps (Without Root)”">​</a></h2><ol><li><p>Install the USB drivers for your device (Google has a list of some <a href="https://developer.android.com/studio/run/oem-usb.html" target="_blank" rel="noreferrer">universal USB drivers here</a>)</p></li><li><p>Download the <a href="https://www.xda-developers.com/google-releases-separate-adb-and-fastboot-binary-downloads/" target="_blank" rel="noreferrer">ADB binary</a> for your particular OS (<a href="https://dl.google.com/android/repository/platform-tools-latest-windows.zip" target="_blank" rel="noreferrer">Windows</a>, <a href="https://dl.google.com/android/repository/platform-tools-latest-darwin.zip" target="_blank" rel="noreferrer">Mac</a>, <a href="https://dl.google.com/android/repository/platform-tools-latest-linux.zip" target="_blank" rel="noreferrer">Linux</a>)</p></li><li><p>Extract the zip file into a folder</p></li><li><p>On your phone, go to Settings and tap on About Phone. Find the Build Number and <strong>tap on it 7 times to enable Developer Options</strong></p></li><li><p>Now enter <em>Developer Options</em> and find <em>USB Debugging</em> and enable it</p></li><li><p>Plug your phone into the computer and change the mode to <strong>&quot;file transfer (MTP)&quot;</strong> mode</p></li><li><p>On your computer, browse to the directory where you extracted the ADB binary</p><img src="/assets/adb-folder.CbzxlXtZ.png" alt="No image, kindly refer the TEXT" style="zoom:67%;"></li><li><p>Launch a Command Prompt in your ADB folder. For Windows users, hold <strong>Shift and Right-clicking</strong> then selecting the <em>&quot;open command prompt here&quot;</em> option</p><p><img src="/assets/adb-open-here.BrPDN2jk.png" alt="No image, kindly refer the TEXT"></p></li><li><p>Once you&#39;re in the command prompt/terminal, enter the following command: <code>adb devices</code></p></li><li><p>You will see that the system is starting the ADB daemon. If this is your first time running ADB, you will see a prompt on your phone asking you to authorize a connection with the computer. Grant it</p></li><li><p>Now if you re-run the <code>adb devices</code> command, the terminal should print the serial number of your device. If so, then you&#39;re ready</p></li><li><p>Execute the following command: <code>adb shell</code></p><img src="/assets/adb-shell.DkkQs0AC.png" alt="No image, kindly refer the TEXT" style="zoom:80%;"></li><li><p>Execute the <code>pm list packages | grep &#39;&lt;OEM/Carrier/App Name&gt;&#39;</code> command to find package names</p><img src="/assets/package-list.Dri7L3L6.png" alt="package list" style="zoom:80%;"></li><li><p>Alternative way:</p><p>You can find the package name of an installed system application by installing the <strong>App Inspector</strong> app on your phone. I prefer doing it this way so you know what the app name is of the application that you are about to uninstall</p><ul><li><p>Step 1: Tap on <em>&quot;App List&quot;</em></p><img src="/assets/app-inspector-1.D0YVYRCB.png" alt="No image, kindly refer the TEXT" style="zoom:50%;"></li><li><p>Step 2: Find the app you want gone. (for example: <em>&quot;Compass&quot;</em>)</p><img src="/assets/app-inspector-2.BV9mp37E.png" alt="No image, kindly refer the TEXT" style="zoom:50%;"></li><li><p>Step 3: Find the package name under the App Name (for example: <em>&quot;com.huawei.compass&quot;</em>)</p><img src="/assets/app-inspector-3.DFhulVkG.png" alt="No image, kindly refer the TEXT" style="zoom:50%;"></li></ul></li><li><p>Execute the command like so: <code>pm uninstall -k --user 0 &lt;name of package&gt;</code> command to uninstall a specific system application</p><img src="data:image/png;base64," alt="package uninstall" style="zoom:50%;"></li></ol><div class="warning custom-block github-alert"><p class="custom-block-title">WARNING</p><p>As a word of warning, uninstalling system applications can be dangerous so please know what you&#39;re getting rid of before you complete these steps. Failing to do so could result in your phone becoming unusable until you perform a factory reset. By removing any given system application, another system application that may depend on it may also break so be careful what you remove. But if something does go wrong, you can always perform a factory reset</p></div>`,6)]])}var s=r(a,[[`render`,o]]);export{i as __pageData,s as default};